CREATE DEFINER=`root`@`localhost` PROCEDURE `discharge_patient` (IN `pat_id` INT)  BEGIN
DECLARE date_of_admit Date;
DECLARE ward_id INT;
SELECT in_patient.date_of_admittance INTO date_of_admit FROM in_patient WHERE `in_patient`.`p_id` = pat_id AND in_patient.date_of_discharge IS NULL;
UPDATE in_patient SET in_patient.date_of_discharge=CURRENT_TIMESTAMP WHERE in_patient.p_id = pat_id AND in_patient.date_of_discharge IS NULL;
SELECT admits.w_id INTO ward_id FROM admits WHERE admits.p_id=pat_id AND admits.date_of_leaving IS NULL;
UPDATE admits SET admits.date_of_leaving=CURRENT_TIMESTAMP WHERE admits.p_id=pat_id AND admits.date_of_leaving IS NULL;
UPDATE ward SET ward.is_avaliable=1 WHERE ward.w_id=ward_id;
UPDATE bill SET bill.no_of_days_admitted = DATEDIFF(CURRENT_DATE,date_of_admit) WHERE bill.p_id=pat_id AND bill.is_issued=0;
UPDATE bill SET bill.ward_charge = bill.ward_charge*bill.no_of_days_admitted WHERE bill.p_id=pat_id AND bill.is_issued=0;
UPDATE bill SET bill.is_issued=1 WHERE bill.p_id=pat_id AND bill.is_issued=0;
UPDATE consults SET consults.appointment_status="discharged" WHERE consults.p_id=pat_id AND consults.appointment_status="admitted";
INSERT INTO `bill` (`bill_no`, `p_id`, `lab_charge`, `doctor_charge`, `medicine_charge`, `ward_charge`, `no_of_days_admitted`, `surgery_charge`, `is_issued`) VALUES (NULL, pat_id, '0', '0', '0', '0', '0', '0', '0');
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `grant_appointment` (IN `app_req_id` INT)  BEGIN
   DECLARE pat_id INT;
   DECLARE doc_id INT;
   DECLARE pat_ailments varchar(30);
   DECLARE cost INT;
   UPDATE request_appointment SET status = 'granted' WHERE request_appointment.req_id = app_req_id;
   SELECT p_id INTO pat_id FROM request_appointment WHERE request_appointment.req_id = app_req_id;
   SELECT d_id INTO doc_id FROM request_appointment WHERE request_appointment.req_id = app_req_id;
   SELECT ailments INTO pat_ailments FROM request_appointment WHERE request_appointment.req_id = app_req_id;
   SELECT doctors.charges into cost FROM doctors WHERE doctors.d_id=doc_id;
   UPDATE bill SET bill.doctor_charge = bill.doctor_charge + cost WHERE bill.p_id=pat_id AND bill.is_issued=0;
INSERT INTO consults (`p_id`, `d_id`, `date_of_consultant`, `m_id`, `ailments`, `appointment_status`) VALUES (pat_id, doc_id,CURRENT_TIMESTAMP , 0, pat_ailments, "pending");
INSERT INTO `out_patient` (`p_id`, `date_of_appointment`, `illness`) VALUES (pat_id, CURRENT_DATE, pat_ailments);
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `grant_medicine` (IN `med_req_id` INT)  BEGIN
   DECLARE pat_id INT;
   DECLARE med_id INT;
   DECLARE no_units INT;
   DECLARE cost INT;
   UPDATE request_medicine SET status = 'granted' WHERE request_medicine.req_id = med_req_id;
   SELECT p_id INTO pat_id FROM request_medicine WHERE request_medicine.req_id = med_req_id;
   SELECT m_id INTO med_id FROM request_medicine WHERE request_medicine.req_id = med_req_id;
   SELECT units INTO no_units FROM request_medicine WHERE request_medicine.req_id = med_req_id;
   SELECT medicine.price into cost FROM medicine WHERE medicine.m_id=med_id;
   UPDATE bill SET bill.medicine_charge = bill.medicine_charge + no_units*cost WHERE bill.p_id=pat_id AND bill.is_issued=0;
   UPDATE medicine SET medicine.units_in_stock = medicine.units_in_stock - no_units WHERE medicine.m_id=med_id;
END$$

